column8:
「プリウスα」「フィットシャトル」用新発売！！
大好評のウェットスーツ素材を使用したラゲージマットです。車種別の専用タイプで新登場。専用設計なのでサイズはピッタリ、裏面が合成ゴムなのでずれにくく、防水素材が愛車のラゲージルームをしっかりとガードします。
（画像上より：ウィッシュ用、ノア用、フリード用、セレナ用の装着イメージになります。） <br>
<br>
品番：7701-98
品質：(表)ポリエステル100％(裏)合成ゴム
